import homePage  from "./component/homePage";
import resultPage from "./component/resultPage";
import admainPage from "./component/admainPage";

function App(props){
    return (
      <BrowserRouter>      
      <Routes>
        <Route path="/" element = {<homePage/>}/>
        <Route path="/result" element = {<resultPage/>}/>
        <Route path="/admain" element = {<admainPagel/>}/>
      </Routes>    
    </BrowserRouter>
    );
}


export default App;
